package com.hackerrank.challenge.strings;

public class SpecialPalindrome {

	public static void main(String[] args) {
		System.out.println(substrCount(55269, ""));
	}
	
	static long substrCount(int n, String s) {
		long result = n;
		
		boolean sameLetters = s.replaceAll(String.valueOf(s.charAt(0)), "").length() == 0;
		
		if (sameLetters) {
			Double doub = n * 2.5D;
			result = doub.longValue();
		} else {
			
			int i = 0;
			while (i + 2 <= n -1) {
				String substr = s.substring(i, i + 3);
				String reverse = new StringBuilder(substr).reverse().toString();
				if (reverse.equals(substr)) {
					result++;
				}
				
				i++;
			}
			
			
			
		}
		
		return result;
    }
}
